import './App.js'
import createSudoku from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  func=()=>{
    root.render(<Sudoku arr={sudoku} />)
  }
  render(){
    return (
      <>
    <input type="button" className='startButton'/>
    <label htmlFor='startButton'>CLICK</label>
    </>
    )
  }
}
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props)

     }
     render(){
      return(
        this.props.arr.map((temp)=><div className='Sudoku'><Row arra={temp}/><br/></div>)
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=>
     { if(temp!==-1)
      return <Element val={temp}/>
      else
      return <Input/>
     }))
  }
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
    return (
      <div className='Element'>
        {this.props.val}
      </div>
    )
  }
}
class Input extends React.Component{
  constructor(){
    super();
  }
  render(){
    return (
      <input type="text" className="Element1"/>
    )
  }
}
